INSERT INTO `catalog_group` VALUES (1,'Очки солнцезащитные','Солнцезащитные очки - очки, надеваемые для защиты глаз от солнечного света и ультрафиолетовых лучей. Они также могут улучшать зрение — если линзы с диоптриями окрашены, поляризованы или затемнены.\nБольшинство людей испытывают дискомфорт от прямого солнечного света, поскольку на улице человеческий глаз получает гораздо больше света, чем в помещении.',NULL,NULL),(3,'Оправы очковые','Очки - самый распространённый из оптических приборов, предназначенный для коррекции человеческого зрения при оптических несовершенствах глаза, либо для защиты глаз от различных вредных воздействий.\n\nОчки состоят из линз, стеклянных или пластиковых, удерживаемых оправой, с прикреплёнными к ней дужками. Изредка вместо дужек, которые закрепляются за ушами, используется лента или ремешок, охватывающий голову.',NULL,NULL),(4,'Контактные линзы','Контактные линзы — линзы, которые надеваются непосредственно на роговицу глаза. Чаще всего они используются с целью коррекции нарушений зрения: близорукости (миопии), дальнозоркости (гиперметропии), астигматизма и пресбиопии. Линзы также могут использоваться для изменения и подчеркивания цвета глаз. В некоторых случаях линзы назначаются с лечебной целью для защиты поверхности глаза.',NULL,NULL),(5,'Расстворы и капли','Расстворы для линз и капли для глаз',NULL,NULL),(6,'Аксессуары для очков','Чехлы, футляры и процие аксессуары',NULL,NULL),(8,'sdfsdfsdfdsfsdfdsfsdfdsfdsfs','test','2020-06-30 13:26:19','2020-06-30 13:26:19');
